'',
'BEGIN',
'',
'  apex_json.initialize_clob_output;',
'',
'  apex_json.open_object;',
'    apex_json.write(''provider'', ''oci'');',
'    apex_json.write(''region'', ''us-chicago-1'');',
'    apex_json.write(''oci_compartment_id'', :P1_COMPARTMENT);',
