'    apex_json.open_array(''object_list'');',
'',
'    For x IN (SELECT COLUMN_VALUE val FROM apex_string.split(:P1_SELECT_OBJECTS,'':''))',
'    LOOP',
'',
'    v_object := x.val;',
'',
'        apex_json.open_object;',
'            apex_json.write(''owner'', ''WKSP_SELECTAIDEMO'');',
'            apex_json.write(''name'', v_object );',
'        apex_json.close_object;',
'',
'    END LOOP;',
'',
