'',
'',
'  v_JSON := apex_json.get_clob_output;',
'',
'  apex_json.free_output;',
'',
'    apex_debug.message (v_json);',
'',
'  DBMS_CLOUD_AI.CREATE_PROFILE(',
'      profile_name => :P1_PROFILE_NAME,',
'      description     => :P1_PROFILE_DESCRIPTION,',
'      attributes   => v_JSON );',
'',
'END;'))
